<body>
    <div class="overlay" id="app">
        <div class="header">Gensight AI</div>
        <!-- Welcome message placed between header and upload section -->
        <!-- Welcome message is placed between the header and the upload section. It uses the same font size and weight as the header. -->
        <p class="welcome-message" id="welcomeMessage">Welcome to Gensight AI! We help you translate complex genetic reports into clear, empathetic answers.</p>
        <div class="file-upload" id="uploadContainer">
            <h2>Upload your genetic report to begin</h2>
            <input type="file" id="fileInput" />
            <button class="start-button" id="startButton">Start</button>
        </div>
        <div class="content" id="chatContainer" style="display:none;"></div>
        <!-- Disclaimer shown above the input bar when chat starts -->
        <div class="disclaimer" id="disclaimer" style="display:none;">
            All interpretations are for informational purposes only. Please consult with your doctor before making any decisions.
        </div>
        <div class="input-bar" id="inputBar" style="display:none;">
            <input type="text" id="userInput" placeholder="Type your message here..." />
            <button id="sendButton">Send</button>
        </div>
    </div>
    <script>
        const chatContainer = document.getElementById('chatContainer');
        const uploadContainer = document.getElementById('uploadContainer');
        const fileInput = document.getElementById('fileInput');
        const startButton = document.getElementById('startButton');
        const inputBar = document.getElementById('inputBar');
        const userInput = document.getElementById('userInput');
        const sendButton = document.getElementById('sendButton');
        // Disclaimer element
        const disclaimer = document.getElementById('disclaimer');
        // Welcome message element (used to hide it once chat begins)
        const welcomeMessage = document.getElementById('welcomeMessage');

        const aiResponses = [
            `This report has found the root cause of your child's symptoms: he has a rare genetic disorder called Lesch-Nyhan Syndrome (LNS).

This explains why your child has two simultaneous types of issues:
 Physical/Metabolic: High uric acid, kidney stones, and blood in the urine (because the body cannot properly process a substance called "purine").
 Neurological: Abnormal muscle tone (such as limb stiffness or uncoordinated movements).

I have distilled the critical information into three points for you:
 The Cause: Your child has a mutation called p.R51X in the HPRT1 gene, leading to HGPRT enzyme deficiency.
 The Impact: Without HGPRT, purines accumulate into uric acid, which simultaneously affects brain development.`,
            `That is a crucial question. I will explain it in three parts:

I. For Your Child (The Patient): Focused, Proactive Care
With a clear diagnosis, your child's care now enters a more directed and proactive phase. The medical team can stop merely reacting to symptoms and start creating a personalized management plan targeting the root cause:
 Renal and Metabolic Management
 Neurological and Motor Support
 Crucial Warning and Preparation of self-injurious behavior

II. For You (The Mother): Understanding "The Carrier State"
I want to gently inform you that the report indicates the HPRT1 gene variant carried by your child was inherited via one of your X chromosomes.
The transmission of a gene is a naturally occurring biological processlike eye color, hair curl, or blood typeit has no moral right or wrong, and it does not signify responsibility.

III. Regarding Future Family Planning
This report also provides a clear scientific basis for your family's future reproductive planning:
 If you conceive naturally again:
  o Boys: There is a 50% chance of inheriting the X chromosome with the variant, thus having the disease; and a 50% chance of being completely healthy.
  o Girls: There is a 50% chance of becoming a healthy carrier like you (usually asymptomatic); and a 50% chance of not carrying the variant and being completely healthy.
 But, most importantly: You now have options.
  o Through Preimplantation Genetic Diagnosis, it is possible to screen the HPRT1 gene status at the embryo stage and only implant healthy embryos into the uterus, thus avoiding the birth of another LNS-affected child.
  o This technology is maturely implemented in many reproductive centers domestically. A genetic counseling doctor will assess your suitability and guide you through the decision-making process.`,

 Step 1: Contact Your Doctors Immediately (Most Urgent!)

 Patient Communities:
   China: Search on WeChat for "LNS".

 Remember: You don't have to carry this burden alone. Professional teams plus shared patient experience are your "external hard drive" of knowledge.`

            chatContainer.style.display = 'flex';
            inputBar.style.display = 'flex';
            // Clear any existing chat content and reset AI index
            chatContainer.innerHTML = '';
            aiIndex = 0;
            // Send the initial greeting from the AI
            addMessage('ai', 'Hello, thank you for trusting me. What can I help?', 'G');
            // Enable the input for the user
            userInput.disabled = false;
            sendButton.disabled = false;
            userInput.placeholder = 'Type your message here...';
            // Show the disclaimer when chat starts
            if (disclaimer) {
                disclaimer.style.display = 'block';
            }
        }

        function handleUserInput() {
            const text = userInput.value.trim();
            if (text === '') return;
            addMessage('user', text, 'M');
            userInput.value = '';
            processAiResponse();
        }

        function processAiResponse() {
            if (aiIndex >= aiResponses.length) {
                return;
            }
            const typingIndicator = document.createElement('div');
            typingIndicator.classList.add('message', 'ai');
            const typingBubble = document.createElement('div');
            typingBubble.classList.add('bubble', 'ai');
            typingBubble.textContent = 'Gensight AI is typing...';
            typingIndicator.appendChild(typingBubble);
            chatContainer.appendChild(typingIndicator);
            scrollToBottom();
            setTimeout(() => {
                typingIndicator.remove();
                const response = aiResponses[aiIndex];
                addMessage('ai', response, 'G');
                aiIndex++;
                if (aiIndex >= aiResponses.length) {
                    // Disable further input once all AI responses are used
                    userInput.disabled = true;
                    sendButton.disabled = true;
                    // Keep the placeholder text as default without changing it to 'Conversation ended'
                }
            }, 1000);
        }

        function addMessage(sender, text, nameLetter) {
            const messageDiv = document.createElement('div');
            messageDiv.classList.add('message');
            messageDiv.classList.add(sender.toLowerCase());

            const avatarDiv = document.createElement('div');
            avatarDiv.classList.add('avatar');
            avatarDiv.classList.add(sender.toLowerCase());
            avatarDiv.textContent = nameLetter;

            const contentDiv = document.createElement('div');
            contentDiv.classList.add('content-msg');

            const nameDiv = document.createElement('div');
            nameDiv.classList.add('name');
            // Determine display name based on sender
            let displayName;
            if (sender.toLowerCase() === 'ai') {
                displayName = 'Gensight AI';
            } else {
                displayName = 'Mother';
            }
            nameDiv.textContent = displayName;

            const bubbleDiv = document.createElement('div');
            bubbleDiv.classList.add('bubble');
            bubbleDiv.classList.add(sender.toLowerCase());
            // Convert newline characters to HTML <br> tags for proper formatting
            bubbleDiv.innerHTML = text.replace(/\n/g, '<br>');

            contentDiv.appendChild(nameDiv);
            contentDiv.appendChild(bubbleDiv);

            messageDiv.appendChild(avatarDiv);
            messageDiv.appendChild(contentDiv);

            chatContainer.appendChild(messageDiv);
            scrollToBottom();
        }

        function scrollToBottom() {
            chatContainer.scrollTop = chatContainer.scrollHeight;
        }
    </script>
</body>
</html>
